window.bookSummaryJSON = "<p>The Game Is Nearing the End!</p> <p>His life hanging by a thread, will Charles manage to once again dodge the bullet?</p> <p>And if he does pull off a miracle, how will he go about stopping the Storm of Souls which is rumored to spell the end for all?</p> <p>The story of Charles Morris and the Empire of Tine is about to come to an end, one way or another. The question is: will it be in joy and victory, with Charles and his allies on top, or will it be in tears and defeat, with Logan claiming yet another round?</p>"; 
